script: |
  super -f text -I q2327.spq | sort > q2327.out

inputs:
  - name: q2327.spq
    data: |
      SELECT ALL + 96 - - col2 + - - col1 * - col1 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE NULL BETWEEN + col2 * 5 * - + col1 / ( + - 96 ) AND NULL;
  - name: tab0

outputs:
  - name: q2327.out
    data: |
